import { VueElement, createApp } from 'vue'
import App from './App.vue'
import { VueI18n } from 'vue-i18n'

VueElement.use(VueI18n)

const i18n = new VueI18n({
    locale: 'en',
    messages: {
        en: {
            message: {
                hello: 'hello world'
            }
        },
        ja: {
            message: {
                hello: 'こんにちは、世界'
            }
        }
    }
})

createApp(App).mount('#app')
